sugeng tanggap warsa, romo !
matur sembah nuwun kangge sedaya pengalaman kaliyan kesempatan ingkang dipunparingi marang kula. mugi-mugi nilai-nilai romo dhateng sekolah sma menika mboten luntur, lan mugi-mugi kula kaliyan rencang sedaya saget mbetha nilai-nilai menika dhateng sesama. Romo Van Lith, doakanlah kami !
